// SPDX-License-Identifier: MIT
pragma solidity ^0.8.1;

import "./Auction.sol";

contract AuctionController {
    struct ActiveAuction {
        address sellerAddress;
        uint createdAt;
        uint energyAmount;
        bool isActive;
    }

    address private owner;
    mapping(address => ActiveAuction) public auctions;
    address[] public auctionAddresses;

    event CreatedAuction(address auction, ActiveAuction details);
    event DeletedAuction(address auction);

    constructor() {
        owner = msg.sender;
    }

    function createNewAuction(
        address payable _seller, 
        uint _energyAmount, 
        uint _minBidValue, 
        uint _depositValue
    ) public payable {
        // Deploy new auction contract
        Auction newAuction = new Auction(
            _seller, 
            _energyAmount, 
            _minBidValue, 
            _depositValue,
            300 // Five minutes
        );

        // Save auction info
        auctionAddresses.push(address(newAuction));
        auctions[address(newAuction)] = ActiveAuction({
            sellerAddress: _seller,
            createdAt: block.timestamp,
            energyAmount: _energyAmount,
            isActive: true
        });

        emit CreatedAuction(address(newAuction), auctions[address(newAuction)]);
    }

    /// Auction cannot be deleted until either:
    ///     (1) Token has been retrieved
    ///     (2) Token has expired
    /// Auction can only be deleted by admin or by the auction seller
    function deleteAuction(address auctionAddress) public {
        Auction auction = Auction(auctionAddress);

        require(msg.sender == auctions[auctionAddress].sellerAddress || msg.sender == owner, "Can only be deleted by admin or the auction seller");
        if (currentTime() < auction.getTokenValidUntil()) {
            require(auction.getCurrentState() == Auction.State.TokenRetrieved);
        }

        auction.deleteAuction();
        delete auctions[auctionAddress];

        emit DeletedAuction(auctionAddress);
    }

    function getAuctionAddresses() public view returns(address[] memory) {
        return auctionAddresses;
    }

    /// Returns a list of all auctions that are open for bids
    function getActiveAuctions() public view returns(address[] memory) {
        address[] memory activeAuctions;
        for(uint i = 0; i < auctionAddresses.length; i++) {
            Auction auction = Auction(auctionAddresses[i]);
            if (auction.getCurrentState() == Auction.State.ReadyForHiddenBids) {
                activeAuctions[i] = auctionAddresses[i];
            }
        }
        return activeAuctions;
    }

    function currentTime() internal view virtual returns(uint) {
        return block.timestamp;
    }
}
